n               &lt;/p&gt;\n               &lt;p&gt;\n               \n                  &lt;persName id=&quot;f17930109-1-person42&quot; type=&quot;jurorName&quot;&gt;\n                     Joseph\n                      Betterton\n                  &lt;interp inst=&quot;f17930109-1-person42&quot; type=&quot;surname&quot; value=&quot;Betterton&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person42&quot; type=&quot;given&quot; value=&quot;Joseph&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person42&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n               \n               &lt;/p&gt;\n               &lt;p&gt;\n               \n                  &lt;persName id=&quot;f17930109-1-person43&quot; type=&quot;jurorName&quot;&gt;\n                     Thomas\n                      Fellows\n                  &lt;interp inst=&quot;f17930109-1-person43&quot; type=&quot;surname&quot; value=&quot;Fellows&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person43&quot; type=&quot;given&quot; value=&quot;Thomas&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person43&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n               \n               &lt;/p&gt;\n               &lt;p&gt;\n               \n                  &lt;persName id=&quot;f17930109-1-person44&quot; type=&quot;jurorName&quot;&gt;\n                     William\n                      Borrett\n                  &lt;interp inst=&quot;f17930109-1-person44&quot; type=&quot;surname&quot; value=&quot;Borrett&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person44&quot; type=&quot;given&quot; value=&quot;William&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person44&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n               \n               &lt;/p&gt;\n               &lt;p&gt;\n               \n                  &lt;persName id=&quot;f17930109-1-person45&quot; type=&quot;jurorName&quot;&gt;\n                     Charles\n                      Skinner\n                  &lt;interp inst=&quot;f17930109-1-person45&quot; type=&quot;surname&quot; value=&quot;Skinner&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person45&quot; type=&quot;given&quot; value=&quot;Charles&quot;/&gt;\n                     &lt;interp inst=&quot;f17930109-1-person45&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n               \n               &lt;/p&gt;\n         \n            &lt;/div1&gt;\n   \n   \n            &lt;div1 type=&quot;trialAccount&quot; id=&quot;t17930109-1&quot;&gt;\n               &lt;interp inst=&quot;t17930109-1&quot; type=&quot;collection&quot; value=&quot;BAILEY&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-1&quot; type=&quot;year&quot; value=&quot;1793&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-1&quot; type=&quot;uri&quot; value=&quot;sessionsPapers/17930109&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-1&quot; type=&quot;date&quot; value=&quot;17930109&quot;/&gt;\n               &lt;join result=&quot;criminalCharge&quot; id=&quot;t17930109-1-off1-c46&quot; targOrder=&quot;Y&quot;\n                     targets=&quot;t17930109-1-defend47 t17930109-1-off1 t17930109-1-verdict5&quot;/&gt;\n               &lt;join result=&quot;criminalCharge&quot; id=&quot;t17930109-1-off1-c47&quot; targOrder=&quot;Y&quot;\n                     targets=&quot;t17930109-1-defend48 t17930109-1-off1 t17930109-1-verdict7&quot;/&gt;\n         \n               &lt;p&gt;\n                  &lt;xptr type=&quot;pageFacsimile&quot; doc=&quot;179301090003&quot;/&gt;123 \n               \n                  &lt;persName id=&quot;t17930109-1-defend47&quot; type=&quot;defendantName&quot;&gt;\n                     SOPHIA \n                     LANGFORD\n                  &lt;interp inst=&quot;t17930109-1-defend47&quot; type=&quot;surname&quot; value=&quot;LANGFORD&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-defend47&quot; type=&quot;given&quot; value=&quot;SOPHIA&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-defend47&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n               \n             and \n               &lt;persName id=&quot;t17930109-1-defend48&quot; type=&quot;defendantName&quot;&gt;\n                  SARAH \n                  TOWNSEND\n               &lt;interp inst=&quot;t17930109-1-defend48&quot; type=&quot;surname&quot; value=&quot;TOWNSEND&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-defend48&quot; type=&quot;given&quot; value=&quot;SARAH&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-defend48&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n             were indicted for &lt;rs id=&quot;t17930109-1-off1&quot; type=&quot;offenceDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-1-off1&quot; type=&quot;offenceCategory&quot; value=&quot;violentTheft&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-off1&quot; type=&quot;offenceSubcategory&quot; value=&quot;highwayRobbery&quot;/&gt;\n               feloniously making an assault, on the King's highway, on \n                     \n                        &lt;persName id=&quot;t17930109-1-victim50&quot; type=&quot;victimName&quot;&gt;\n                           Mary \n                           Price\n                        &lt;interp inst=&quot;t17930109-1-victim50&quot; type=&quot;surname&quot; value=&quot;Price&quot;/&gt;\n                        &lt;interp inst=&quot;t17930109-1-victim50&quot; type=&quot;given&quot; value=&quot;Mary&quot;/&gt;\n                        &lt;interp inst=&quot;t17930109-1-victim50&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                        &lt;join result=&quot;offenceVictim&quot; targOrder=&quot;Y&quot;\n                              targets=&quot;t17930109-1-off1 t17930109-1-victim50&quot;/&gt;\n                     &lt;/persName&gt;\n                     \n                  , &lt;rs id=&quot;t17930109-1-viclabel2&quot; type=&quot;occupation&quot;&gt;spinster&lt;/rs&gt;\n                     &lt;join result=&quot;persNameOccupation&quot; targOrder=&quot;Y&quot;\n                           targets=&quot;t17930109-1-victim50 t17930109-1-viclabel2&quot;/&gt;, on the &lt;rs id=&quot;t17930109-1-cd3&quot; type=&quot;crimeDate&quot;&gt;2d of January&lt;/rs&gt;\n                     &lt;join result=&quot;offenceCrimeDate&quot; targOrder=&quot;Y&quot;\n                           targets=&quot;t17930109-1-off1 t17930109-1-cd3&quot;/&gt;, and putting her in fear and feloniously taking from her person and against her will, a wooden box containing some powder called medicine powder, value 1 s. the goods of John Price, and one shilling in money\n            &lt;/rs&gt;, the money of the said \n               &lt;persName id=&quot;t17930109-1-person51&quot;&gt;\n                  Mary\n                   Price\n               &lt;interp inst=&quot;t17930109-1-person51&quot; type=&quot;surname&quot; value=&quot;Price&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person51&quot; type=&quot;given&quot; value=&quot;Mary&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person51&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n            .&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person52&quot;&gt;\n                  MARY\n                   PRICE\n               &lt;interp inst=&quot;t17930109-1-person52&quot; type=&quot;surname&quot; value=&quot;PRICE&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person52&quot; type=&quot;given&quot; value=&quot;MARY&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person52&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am with my brother, he is a jeweller, he lives at No. 71, Fetter-lane; I was robbed on Saturday night, about ten o'clock, near Somerset house in the &lt;placeName id=&quot;t17930109-1-crimeloc4&quot;&gt;Strand&lt;/placeName&gt;\n                  &lt;interp inst=&quot;t17930109-1-crimeloc4&quot; type=&quot;placeName&quot; value=&quot;Strand&quot;/&gt;\n                  &lt;interp inst=&quot;t17930109-1-crimeloc4&quot; type=&quot;type&quot; value=&quot;crimeLocation&quot;/&gt;\n                  &lt;join result=&quot;offencePlace&quot; targOrder=&quot;Y&quot;\n                        targets=&quot;t17930109-1-off1 t17930109-1-crimeloc4&quot;/&gt;, there two women met me and stopped me and asked me for some gin; I never saw them before in my life; I told them I would not give them any, I had not got any money; I was coming from Westminster; I keep my brother's house and work at my needle; they then asked me for a pocket handkerchief, and then Townsend put her right hand down my bosom, and her left hand into my left hand pocket, and Langford put her hand into my right hand pocket and took out a small box containing some medicine powder in it and a shilling; I endeavoured to prevent it, I said, pray don't pick my pocket; they said, they would, and \n               &lt;persName id=&quot;t17930109-1-person53&quot;&gt;\n                  Sophia\n                   Langford\n               &lt;interp inst=&quot;t17930109-1-person53&quot; type=&quot;surname&quot; value=&quot;Langford&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person53&quot; type=&quot;given&quot; value=&quot;Sophia&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person53&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n             said, she would take her bloody knife out of her pocket and run it through my heart if I spoke, and would twist it round her arm; I made my escape on to the other side of the way, they followed me, Langford kept the box, and she came and struck me again, and put her hand into my pocket the second time, and she struck me over the head; they took nothing more out of my pocket, but rattled the box over my head; I applied to a waterman that was there; I don't know his name; but I did not take them up till Thursday, they were then taken up by the two patroles, I was with them, I found them up almost by Temple-bar; I am sure they are the same women perfectly; there was a light near where I was robbed; I never recovered the box with the powder, it might be the value of another shilling; I was alone at the time, but the next witness saw the transaction, he joined me.&lt;/p&gt;\n               &lt;p&gt;Prisoner Langford. On Wednesday evening, I do not recollect being out at any such an hour. - I am sure that is the woman, she took the box away from me and struck me.&lt;/p&gt;\n               &lt;p&gt;Prisoner Townsend. I never recollect seeing the woman before Thursday night. - That is the woman I am perfectly sure.&lt;/p&gt;\n               &lt;p&gt;Court. When you found them on Thursday did you find them together? - I did, both walking together.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person54&quot;&gt;\n                  EDWARD\n                   CLARKE\n               &lt;interp inst=&quot;t17930109-1-person54&quot; type=&quot;surname&quot; value=&quot;CLARKE&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person54&quot; type=&quot;given&quot; value=&quot;EDWARD&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person54&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a hair dresser by business, but I follow the brokery at present with my uncle; I had been on a message to old Round-court in the Strand, returning from thence I saw the prisoners at the bar insult the prosecutor; I am certain they are the same, they put their hands into her bosom and into her pockets, the one I think that did it was she in the dark own, Langford, the other, was standing by; Langford, she took something&lt;xptr type=&quot;pageFacsimile&quot; doc=&quot;179301090004&quot;/&gt;from her, but what I cannot tell, she put her hand down her bosom and in her pockets, the girl was making a terrible piece of work at the time, and turning herself round very quick, Langford she had something in her hand which she shaked over the last witness's head, they called her some infamous names, Townsend called her a bloody sow, and they said, if ever she came that way again they would cut her head open or off, I cannot tell which, this was after they had taken it, and desired her to go about her business, and Langford beat her about the head; on the girl's running away, I went up to her and asked her what was the matter; she told me, she had lost a small box containing some medicines, the women then had left her; I did not see the other woman do any thing at the time the box was taken, she might have done something, but I did not see it; I desired her to stop and I would go to the prisoners and ask them for the box; I followed them to Southampton-street, Covent-garden, I asked them to return the box, and that Langford called me that bloody slanger, or said, I was the bloody slanger that belonged to the bloody whore, and if I did not make the best of my way she would cut my bloody head open; with that I made the best of my way from them to look for a watchman, but I could not find a watchman or patrole for some time, when I got a watchman I went back again and they were gone, and I returned home; I am positive they are the same persons.&lt;/p&gt;\n               &lt;p&gt;Prisoner Langford. I never saw the woman till she brought the person on Thursday, when I was detained till the next day.&lt;/p&gt;\n               &lt;p&gt;Clarke. The prisoner Townsend seemed to be very much in liquor at the time.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person55&quot;&gt;\n                  CHARLES\n                   DELMAN\n               &lt;interp inst=&quot;t17930109-1-person55&quot; type=&quot;surname&quot; value=&quot;DELMAN&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person55&quot; type=&quot;given&quot; value=&quot;CHARLES&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person55&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a clerk to an attorney. On Wednesday evening the girl called on me, and told me she had been robbed; I asked her, if she knew the people? She said, she should; I recommended her to go the following night and speak to the constables and patroles, and take them up; I went with her, she saw the prisoners coming rather behind Temple-bar, towards Arundell-street in the Strand, she knew the prisoners and said, there are the two women that robbed me; when they came up the patrole took them to the watch-house, and the girl there charged them with having robbed her and having struck her, once on the Somerset house side of the Strand, and afterwards following her on the other side and striking her again; the prisoners both declared they had never seen the prosecutrix in their lives.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person56&quot;&gt;\n                  ROBERT\n                   NOAKES\n               &lt;interp inst=&quot;t17930109-1-person56&quot; type=&quot;surname&quot; value=&quot;NOAKES&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person56&quot; type=&quot;given&quot; value=&quot;ROBERT&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person56&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a patrole belonging to St. Clement's; I knew nothing of this till Thursday night between seven and eight o'clock, I took \n               &lt;persName id=&quot;t17930109-1-person57&quot;&gt;\n                  Sophia\n                   Langford\n               &lt;interp inst=&quot;t17930109-1-person57&quot; type=&quot;surname&quot; value=&quot;Langford&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person57&quot; type=&quot;given&quot; value=&quot;Sophia&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person57&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n            , and the other patrole with me took the other, and we took them to St. Clement's-lane watch-house, and then told them what it was for, the prosecutrix came there and laid the charge against them.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person58&quot;&gt;\n                  GEORGE\n                   SALLIS\n               &lt;interp inst=&quot;t17930109-1-person58&quot; type=&quot;surname&quot; value=&quot;SALLIS&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person58&quot; type=&quot;given&quot; value=&quot;GEORGE&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person58&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a patrole; I assisted the other in taking them up.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person59&quot;&gt;\n                  JAMES\n                   TALBOYS\n               &lt;interp inst=&quot;t17930109-1-person59&quot; type=&quot;surname&quot; value=&quot;TALBOYS&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person59&quot; type=&quot;given&quot; value=&quot;JAMES&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person59&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am beadle and watch-house keeper to the parish of St. Clement's; these girls were brought to the watch-house on Thursday about half after nine or not quite so much, the young woman told me that them two women had robbed her the night before, she said, she was robbed of a little box of medicines and a shilling in silver, and that she had been ill treated, they declared they never saw&lt;xptr type=&quot;pageFacsimile&quot; doc=&quot;179301090005&quot;/&gt;her in their lives before; I searched the prisoners but found nothing relating to this.&lt;/p&gt;\n               &lt;p&gt;Court to Prosecutrix. At the time these women made this attack on you, did they say any thing more than you described; did they assign any reason either of them for taking the money from you? - They did not.&lt;/p&gt;\n               &lt;p&gt;Q. Had you been walking up and down there? - I had not.&lt;/p&gt;\n               &lt;p&gt;Q. Did you understand at all, the reasons for what they wanted the money of you? - For some gin, that was all that passed.&lt;/p&gt;\n               &lt;p&gt;Court to Clarke. I understand that one of these women said, that if she came there again they would cut her bloody head open or off; what did you understand by that? - I did not hear any thing pass more than what I have mentioned.&lt;/p&gt;\n               &lt;p&gt;Prisoner Langford. I never saw the woman till Thursday, or saw the box or the shilling that she has sworn to; I should wish her to look very close to see if I am the person that robbed her of the shilling.&lt;/p&gt;\n               &lt;p&gt;Prisoner Townsend. At the same time the gentlewoman charged me with the same robbery; I never saw her before the Thursday night we were both walking down to my sister's in the city.&lt;/p&gt;\n               &lt;p&gt;Court to Mary Price. These medicines are said to be the property of Mr. \n               &lt;persName id=&quot;t17930109-1-person60&quot;&gt;\n                  John\n                   Price\n               &lt;interp inst=&quot;t17930109-1-person60&quot; type=&quot;surname&quot; value=&quot;Price&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person60&quot; type=&quot;given&quot; value=&quot;John&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person60&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n            , who is he? - That is my brother, the box and medicines was my brother's, the shilling was my own.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person61&quot;&gt;\n                  Sophia\n                   Langford\n               &lt;interp inst=&quot;t17930109-1-person61&quot; type=&quot;surname&quot; value=&quot;Langford&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person61&quot; type=&quot;given&quot; value=&quot;Sophia&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person61&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n            , &lt;rs id=&quot;t17930109-1-verdict5&quot; type=&quot;verdictDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-1-verdict5&quot; type=&quot;verdictCategory&quot; value=&quot;guilty&quot;/&gt;\n               GUILTY\n            &lt;/rs&gt;. &lt;rs id=&quot;t17930109-1-punish6&quot; type=&quot;punishmentDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-1-punish6&quot; type=&quot;punishmentCategory&quot; value=&quot;death&quot;/&gt;\n                     &lt;join result=&quot;defendantPunishment&quot; targOrder=&quot;Y&quot;\n                           targets=&quot;t17930109-1-defend47 t17930109-1-punish6&quot;/&gt;\n               Death\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person62&quot;&gt;\n                  Sarah\n                   Townsend\n               &lt;interp inst=&quot;t17930109-1-person62&quot; type=&quot;surname&quot; value=&quot;Townsend&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person62&quot; type=&quot;given&quot; value=&quot;Sarah&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-1-person62&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n            , &lt;rs id=&quot;t17930109-1-verdict7&quot; type=&quot;verdictDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-1-verdict7&quot; type=&quot;verdictCategory&quot; value=&quot;guilty&quot;/&gt;\n               GUILTY\n            &lt;/rs&gt;. &lt;rs id=&quot;t17930109-1-punish8&quot; type=&quot;punishmentDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-1-punish8&quot; type=&quot;punishmentCategory&quot; value=&quot;death&quot;/&gt;\n                     &lt;join result=&quot;defendantPunishment&quot; targOrder=&quot;Y&quot;\n                           targets=&quot;t17930109-1-defend48 t17930109-1-punish8&quot;/&gt;\n               Death\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;Tried by the first Middlesex Jury before Mr. RECORDER.&lt;/p&gt;\n            &lt;/div1&gt;\n   \n   \n            &lt;div1 type=&quot;trialAccount&quot; id=&quot;t17930109-2&quot;&gt;\n               &lt;interp inst=&quot;t17930109-2&quot; type=&quot;collection&quot; value=&quot;BAILEY&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-2&quot; type=&quot;year&quot; value=&quot;1793&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-2&quot; type=&quot;uri&quot; value=&quot;sessionsPapers/17930109&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-2&quot; type=&quot;date&quot; value=&quot;17930109&quot;/&gt;\n               &lt;join result=&quot;criminalCharge&quot; id=&quot;t17930109-2-off9-c61&quot; targOrder=&quot;Y&quot;\n                     targets=&quot;t17930109-2-defend64 t17930109-2-off9 t17930109-2-verdict13&quot;/&gt;\n         \n               &lt;p&gt;124. \n               \n                  &lt;persName id=&quot;t17930109-2-defend64&quot; type=&quot;defendantName&quot;&gt;\n                     CHARLES \n                     CRAWLEY\n                  &lt;interp inst=&quot;t17930109-2-defend64&quot; type=&quot;surname&quot; value=&quot;CRAWLEY&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-defend64&quot; type=&quot;given&quot; value=&quot;CHARLES&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-defend64&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-defend64&quot; type=&quot;age&quot; value=&quot;eleven years old and six months&quot;/&gt;\n                  &lt;/persName&gt;\n               \n             was indicted for &lt;rs id=&quot;t17930109-2-off9&quot; type=&quot;offenceDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-2-off9&quot; type=&quot;offenceCategory&quot; value=&quot;theft&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-off9&quot; type=&quot;offenceSubcategory&quot; value=&quot;shoplifting&quot;/&gt;\n               feloniously stealing, on the &lt;rs id=&quot;t17930109-2-cd10&quot; type=&quot;crimeDate&quot;&gt;31st of December&lt;/rs&gt;\n                     &lt;join result=&quot;offenceCrimeDate&quot; targOrder=&quot;Y&quot;\n                           targets=&quot;t17930109-2-off9 t17930109-2-cd10&quot;/&gt;, four silk handkerchiefs, value 15 s. the goods of \n                     \n                        &lt;persName id=&quot;t17930109-2-victim66&quot; type=&quot;victimName&quot;&gt;\n                           Harry \n                           Baker\n                        &lt;interp inst=&quot;t17930109-2-victim66&quot; type=&quot;surname&quot; value=&quot;Baker&quot;/&gt;\n                        &lt;interp inst=&quot;t17930109-2-victim66&quot; type=&quot;given&quot; value=&quot;Harry&quot;/&gt;\n                        &lt;interp inst=&quot;t17930109-2-victim66&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                        &lt;join result=&quot;offenceVictim&quot; targOrder=&quot;Y&quot;\n                              targets=&quot;t17930109-2-off9 t17930109-2-victim66&quot;/&gt;\n                     &lt;/persName&gt;\n                     \n                  , privately in his shop\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-2-person67&quot;&gt;\n                  WILLIAM\n                   ANDERSON\n               &lt;interp inst=&quot;t17930109-2-person67&quot; type=&quot;surname&quot; value=&quot;ANDERSON&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-person67&quot; type=&quot;given&quot; value=&quot;WILLIAM&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-person67&quot; type=&quot;gender&quot; value=&quot;male&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am shopman to Mr. Baker, No. 12, &lt;placeName id=&quot;t17930109-2-crimeloc11&quot;&gt;Pall Mall&lt;/placeName&gt;\n                  &lt;interp inst=&quot;t17930109-2-crimeloc11&quot; type=&quot;placeName&quot; value=&quot;Pall Mall&quot;/&gt;\n                  &lt;interp inst=&quot;t17930109-2-crimeloc11&quot; type=&quot;type&quot; value=&quot;crimeLocation&quot;/&gt;\n                  &lt;join result=&quot;offencePlace&quot; targOrder=&quot;Y&quot;\n                        targets=&quot;t17930109-2-off9 t17930109-2-crimeloc11&quot;/&gt;, a &lt;rs id=&quot;t17930109-2-viclabel12&quot; type=&quot;occupation&quot;&gt;linen draper&lt;/rs&gt;\n                  &lt;join result=&quot;persNameOccupation&quot; targOrder=&quot;Y&quot;\n                        targets=&quot;t17930109-2-victim66 t17930109-2-viclabel12&quot;/&gt;; there was another lad and him came into our shop, on the 31st of December last, about five o'clock, they asked for some worsted stockings, I shewed them some at 18 d. a pair, that the other boy thought too much and the prisoner took the handkerchiefs out of the window, they came in together, he stood close by the window; I did not see him take them; but before he came in there were handkerchiefs there; I am sure they were there at the time they came in; the handkerchiefs were close to the glass so as to be seen on the outside; as soon as ever they were gone I missed the handkerchiefs. The other boy said, he had no more than a shilling, and then they both ran away; I looked at the window directly and I found the handkerchiefs gone; I immediately pursued them; I saw which way they went, they turned to the left and went up Market-lane; I ran after them into the market, and I saw Crawley throw the handkerchiefs from under his coat under a dark window, when I was not three yards from him.&lt;/p&gt;\n               &lt;p&gt;Q. Could you see what he threw down? - No, I went and picked up what he threw down and laid hold of him; they were my handkerchiefs, and the person was the prisoner Crawley: I am quite sure that the boy I laid hold of in the street was the same boy who was in the shop by the window.&lt;/p&gt;\n               &lt;p&gt;Q. If I understand you right you did not see him take the handkerchiefs, but you knew they were there when he came in, and you missed them immediately as he went out? - It was so.&lt;/p&gt;\n               &lt;p&gt;Q. Was there any body else came in? - There was a woman came in before the boys went out, she stood at the same counter further on in the shop, she&lt;xptr type=&quot;pageFacsimile&quot; doc=&quot;179301090006&quot;/&gt;bought a pair of stockings but not of me.&lt;/p&gt;\n               &lt;p&gt;(The handkerchiefs produced and deposed to.)&lt;/p&gt;\n               &lt;p&gt;Prisoner. I am eleven years old; he took me out of St. James's-market and said, I stole the handkerchiefs; they stripped me naked and then they took and put marks on them; there were other boys running along besides me; I have a father and a mother, my mother carries loads in the market; I have no friends here now; I have been in prison a week or better.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-2-person68&quot;&gt;\n                  CATHARINE\n                   CRAWLEY\n               &lt;interp inst=&quot;t17930109-2-person68&quot; type=&quot;surname&quot; value=&quot;CRAWLEY&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-person68&quot; type=&quot;given&quot; value=&quot;CATHARINE&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-2-person68&quot; type=&quot;gender&quot; value=&quot;female&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;This is my son; I don't know what to say about it, he left his master twice, he was with the philanthropic society; he does not live with me, and two boys in the street enticed him away; he is eleven years old and six months.&lt;/p&gt;\n               &lt;p&gt;\n                  &lt;rs id=&quot;t17930109-2-verdict13&quot; type=&quot;verdictDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-2-verdict13&quot; type=&quot;verdictCategory&quot; value=&quot;guilty&quot;/&gt;\n               GUILTY\n            &lt;/rs&gt;. &lt;rs id=&quot;t17930109-2-punish14&quot; type=&quot;punishmentDescription&quot;&gt;\n                     &lt;interp inst=&quot;t17930109-2-punish14&quot; type=&quot;punishmentCategory&quot; value=&quot;death&quot;/&gt;\n                     &lt;join result=&quot;defendantPunishment&quot; targOrder=&quot;Y&quot;\n                           targets=&quot;t17930109-2-defend64 t17930109-2-punish14&quot;/&gt;\n               Death\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;Tried by the first Middlesex Jury before the Lord CHIEF BARON.&lt;/p&gt;\n            &lt;/div1&gt;\n   \n   \n            &lt;div1 type=&quot;trialAccount&quot; id=&quot;t17930109-3&quot;&gt;\n               &lt;interp inst=&quot;t17930109-3&quot; type=&quot;collection&quot; value=&quot;BAILEY&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-3&quot; type=&quot;year&quot; value=&quot;1793&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-3&quot; type=&quot;uri&quot; value=&quot;sessionsPapers/17930109&quot;/&gt;\n               &lt;interp inst=&quot;t17930109-3&quot; type=&quot;date&quot; value=&quot;17930109&quot;/&gt;\n               &lt;join result=&quot;criminalCharge&quot; id=&quot;t17930109-3-off15-c65&quot; targOrder=&quot;Y&quot;\n                     targets=&quot;t17930109-3-defend70 t17930109-3-off15 t17930109-3-verdict19&quot;/&gt;\n         \n               &lt;p&gt;125. \n               \n                  &lt;persName id=&quot;t17930109-3-defend70&quot; type=&quot;defendantName&quot;&gt;\n                     JAMES \n                     FEILD\n                  &lt;interp inst=&quot;t17930109-3-defend70&quot; type=&quot;surname&quot; value=&quot;FEILD&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-3-defend70&quot; type=&quot;given&quot; value=&quot;JAMES&quot;/&gt;\n                     &lt;interp inst=&quot;t17930109-3-defend70&quot; type=&quot;gender&quot; va &quot; inst=&quot;t17930109-1-victim50&quot;/&gt;\n                        &lt;join targets=&quot;t17930109-1-off1 t17930109-1-victim50&quot; targOrder=&quot;Y&quot; result=&quot;offenceVictim&quot;/&gt;\n                     &lt;/persName&gt;\n                     \n                  , &lt;rs type=&quot;occupation&quot; id=&quot;t17930109-1-viclabel2&quot;&gt;spinster&lt;/rs&gt;\n                     &lt;join targets=&quot;t17930109-1-victim50 t17930109-1-viclabel2&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;/&gt;, on the &lt;rs type=&quot;crimeDate&quot; id=&quot;t17930109-1-cd3&quot;&gt;2d of January&lt;/rs&gt;\n                     &lt;join targets=&quot;t17930109-1-off1 t17930109-1-cd3&quot; targOrder=&quot;Y&quot; result=&quot;offenceCrimeDate&quot;/&gt;, and putting her in fear and feloniously taking from her person and against her will, a wooden box containing some powder called medicine powder, value 1 s. the goods of John Price, and one shilling in money\n            &lt;/rs&gt;, the money of the said \n               &lt;persName id=&quot;t17930109-1-person51&quot;&gt;\n                  Mary\n                   Price\n               &lt;interp value=&quot;Price&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person51&quot;/&gt;\n                     &lt;interp value=&quot;Mary&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person51&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person51&quot;/&gt;\n                  &lt;/persName&gt;\n            .&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person52&quot;&gt;\n                  MARY\n                   PRICE\n               &lt;interp value=&quot;PRICE&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person52&quot;/&gt;\n                     &lt;interp value=&quot;MARY&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person52&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person52&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am with my brother, he is a jeweller, he lives at No. 71, Fetter-lane; I was robbed on Saturday night, about ten o'clock, near Somerset house in the &lt;placeName id=&quot;t17930109-1-crimeloc4&quot;&gt;Strand&lt;/placeName&gt;\n                  &lt;interp value=&quot;Strand&quot; type=&quot;placeName&quot; inst=&quot;t17930109-1-crimeloc4&quot;/&gt;\n                  &lt;interp value=&quot;crimeLocation&quot; type=&quot;type&quot; inst=&quot;t17930109-1-crimeloc4&quot;/&gt;\n                  &lt;join targets=&quot;t17930109-1-off1 t17930109-1-crimeloc4&quot; targOrder=&quot;Y&quot; result=&quot;offencePlace&quot;/&gt;, there two women met me and stopped me and asked me for some gin; I never saw them before in my life; I told them I would not give them any, I had not got any money; I was coming from Westminster; I keep my brother's house and work at my needle; they then asked me for a pocket handkerchief, and then Townsend put her right hand down my bosom, and her left hand into my left hand pocket, and Langford put her hand into my right hand pocket and took out a small box containing some medicine powder in it and a shilling; I endeavoured to prevent it, I said, pray don't pick my pocket; they said, they would, and \n               &lt;persName id=&quot;t17930109-1-person53&quot;&gt;\n                  Sophia\n                   Langford\n               &lt;interp value=&quot;Langford&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person53&quot;/&gt;\n                     &lt;interp value=&quot;Sophia&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person53&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person53&quot;/&gt;\n                  &lt;/persName&gt;\n             said, she would take her bloody knife out of her pocket and run it through my heart if I spoke, and would twist it round her arm; I made my escape on to the other side of the way, they followed me, Langford kept the box, and she came and struck me again, and put her hand into my pocket the second time, and she struck me over the head; they took nothing more out of my pocket, but rattled the box over my head; I applied to a waterman that was there; I don't know his name; but I did not take them up till Thursday, they were then taken up by the two patroles, I was with them, I found them up almost by Temple-bar; I am sure they are the same women perfectly; there was a light near where I was robbed; I never recovered the box with the powder, it might be the value of another shilling; I was alone at the time, but the next witness saw the transaction, he joined me.&lt;/p&gt;\n               &lt;p&gt;Prisoner Langford. On Wednesday evening, I do not recollect being out at any such an hour. - I am sure that is the woman, she took the box away from me and struck me.&lt;/p&gt;\n               &lt;p&gt;Prisoner Townsend. I never recollect seeing the woman before Thursday night. - That is the woman I am perfectly sure.&lt;/p&gt;\n               &lt;p&gt;Court. When you found them on Thursday did you find them together? - I did, both walking together.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person54&quot;&gt;\n                  EDWARD\n                   CLARKE\n               &lt;interp value=&quot;CLARKE&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person54&quot;/&gt;\n                     &lt;interp value=&quot;EDWARD&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person54&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person54&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a hair dresser by business, but I follow the brokery at present with my uncle; I had been on a message to old Round-court in the Strand, returning from thence I saw the prisoners at the bar insult the prosecutor; I am certain they are the same, they put their hands into her bosom and into her pockets, the one I think that did it was she in the dark own, Langford, the other, was standing by; Langford, she took something&lt;xptr doc=&quot;179301090004&quot; type=&quot;pageFacsimile&quot;/&gt;from her, but what I cannot tell, she put her hand down her bosom and in her pockets, the girl was making a terrible piece of work at the time, and turning herself round very quick, Langford she had something in her hand which she shaked over the last witness's head, they called her some infamous names, Townsend called her a bloody sow, and they said, if ever she came that way again they would cut her head open or off, I cannot tell which, this was after they had taken it, and desired her to go about her business, and Langford beat her about the head; on the girl's running away, I went up to her and asked her what was the matter; she told me, she had lost a small box containing some medicines, the women then had left her; I did not see the other woman do any thing at the time the box was taken, she might have done something, but I did not see it; I desired her to stop and I would go to the prisoners and ask them for the box; I followed them to Southampton-street, Covent-garden, I asked them to return the box, and that Langford called me that bloody slanger, or said, I was the bloody slanger that belonged to the bloody whore, and if I did not make the best of my way she would cut my bloody head open; with that I made the best of my way from them to look for a watchman, but I could not find a watchman or patrole for some time, when I got a watchman I went back again and they were gone, and I returned home; I am positive they are the same persons.&lt;/p&gt;\n               &lt;p&gt;Prisoner Langford. I never saw the woman till she brought the person on Thursday, when I was detained till the next day.&lt;/p&gt;\n               &lt;p&gt;Clarke. The prisoner Townsend seemed to be very much in liquor at the time.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person55&quot;&gt;\n                  CHARLES\n                   DELMAN\n               &lt;interp value=&quot;DELMAN&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person55&quot;/&gt;\n                     &lt;interp value=&quot;CHARLES&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person55&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person55&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a clerk to an attorney. On Wednesday evening the girl called on me, and told me she had been robbed; I asked her, if she knew the people? She said, she should; I recommended her to go the following night and speak to the constables and patroles, and take them up; I went with her, she saw the prisoners coming rather behind Temple-bar, towards Arundell-street in the Strand, she knew the prisoners and said, there are the two women that robbed me; when they came up the patrole took them to the watch-house, and the girl there charged them with having robbed her and having struck her, once on the Somerset house side of the Strand, and afterwards following her on the other side and striking her again; the prisoners both declared they had never seen the prosecutrix in their lives.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person56&quot;&gt;\n                  ROBERT\n                   NOAKES\n               &lt;interp value=&quot;NOAKES&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person56&quot;/&gt;\n                     &lt;interp value=&quot;ROBERT&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person56&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person56&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a patrole belonging to St. Clement's; I knew nothing of this till Thursday night between seven and eight o'clock, I took \n               &lt;persName id=&quot;t17930109-1-person57&quot;&gt;\n                  Sophia\n                   Langford\n               &lt;interp value=&quot;Langford&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person57&quot;/&gt;\n                     &lt;interp value=&quot;Sophia&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person57&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person57&quot;/&gt;\n                  &lt;/persName&gt;\n            , and the other patrole with me took the other, and we took them to St. Clement's-lane watch-house, and then told them what it was for, the prosecutrix came there and laid the charge against them.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person58&quot;&gt;\n                  GEORGE\n                   SALLIS\n               &lt;interp value=&quot;SALLIS&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person58&quot;/&gt;\n                     &lt;interp value=&quot;GEORGE&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person58&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person58&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am a patrole; I assisted the other in taking them up.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person59&quot;&gt;\n                  JAMES\n                   TALBOYS\n               &lt;interp value=&quot;TALBOYS&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person59&quot;/&gt;\n                     &lt;interp value=&quot;JAMES&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person59&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person59&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am beadle and watch-house keeper to the parish of St. Clement's; these girls were brought to the watch-house on Thursday about half after nine or not quite so much, the young woman told me that them two women had robbed her the night before, she said, she was robbed of a little box of medicines and a shilling in silver, and that she had been ill treated, they declared they never saw&lt;xptr doc=&quot;179301090005&quot; type=&quot;pageFacsimile&quot;/&gt;her in their lives before; I searched the prisoners but found nothing relating to this.&lt;/p&gt;\n               &lt;p&gt;Court to Prosecutrix. At the time these women made this attack on you, did they say any thing more than you described; did they assign any reason either of them for taking the money from you? - They did not.&lt;/p&gt;\n               &lt;p&gt;Q. Had you been walking up and down there? - I had not.&lt;/p&gt;\n               &lt;p&gt;Q. Did you understand at all, the reasons for what they wanted the money of you? - For some gin, that was all that passed.&lt;/p&gt;\n               &lt;p&gt;Court to Clarke. I understand that one of these women said, that if she came there again they would cut her bloody head open or off; what did you understand by that? - I did not hear any thing pass more than what I have mentioned.&lt;/p&gt;\n               &lt;p&gt;Prisoner Langford. I never saw the woman till Thursday, or saw the box or the shilling that she has sworn to; I should wish her to look very close to see if I am the person that robbed her of the shilling.&lt;/p&gt;\n               &lt;p&gt;Prisoner Townsend. At the same time the gentlewoman charged me with the same robbery; I never saw her before the Thursday night we were both walking down to my sister's in the city.&lt;/p&gt;\n               &lt;p&gt;Court to Mary Price. These medicines are said to be the property of Mr. \n               &lt;persName id=&quot;t17930109-1-person60&quot;&gt;\n                  John\n                   Price\n               &lt;interp value=&quot;Price&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person60&quot;/&gt;\n                     &lt;interp value=&quot;John&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person60&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person60&quot;/&gt;\n                  &lt;/persName&gt;\n            , who is he? - That is my brother, the box and medicines was my brother's, the shilling was my own.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person61&quot;&gt;\n                  Sophia\n                   Langford\n               &lt;interp value=&quot;Langford&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person61&quot;/&gt;\n                     &lt;interp value=&quot;Sophia&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person61&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person61&quot;/&gt;\n                  &lt;/persName&gt;\n            , &lt;rs type=&quot;verdictDescription&quot; id=&quot;t17930109-1-verdict5&quot;&gt;\n                     &lt;interp value=&quot;guilty&quot; type=&quot;verdictCategory&quot; inst=&quot;t17930109-1-verdict5&quot;/&gt;\n               GUILTY\n            &lt;/rs&gt;. &lt;rs type=&quot;punishmentDescription&quot; id=&quot;t17930109-1-punish6&quot;&gt;\n                     &lt;interp value=&quot;death&quot; type=&quot;punishmentCategory&quot; inst=&quot;t17930109-1-punish6&quot;/&gt;\n                     &lt;join targets=&quot;t17930109-1-defend47 t17930109-1-punish6&quot; targOrder=&quot;Y&quot; result=&quot;defendantPunishment&quot;/&gt;\n               Death\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-1-person62&quot;&gt;\n                  Sarah\n                   Townsend\n               &lt;interp value=&quot;Townsend&quot; type=&quot;surname&quot; inst=&quot;t17930109-1-person62&quot;/&gt;\n                     &lt;interp value=&quot;Sarah&quot; type=&quot;given&quot; inst=&quot;t17930109-1-person62&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-1-person62&quot;/&gt;\n                  &lt;/persName&gt;\n            , &lt;rs type=&quot;verdictDescription&quot; id=&quot;t17930109-1-verdict7&quot;&gt;\n                     &lt;interp value=&quot;guilty&quot; type=&quot;verdictCategory&quot; inst=&quot;t17930109-1-verdict7&quot;/&gt;\n               GUILTY\n            &lt;/rs&gt;. &lt;rs type=&quot;punishmentDescription&quot; id=&quot;t17930109-1-punish8&quot;&gt;\n                     &lt;interp value=&quot;death&quot; type=&quot;punishmentCategory&quot; inst=&quot;t17930109-1-punish8&quot;/&gt;\n                     &lt;join targets=&quot;t17930109-1-defend48 t17930109-1-punish8&quot; targOrder=&quot;Y&quot; result=&quot;defendantPunishment&quot;/&gt;\n               Death\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;Tried by the first Middlesex Jury before Mr. RECORDER.&lt;/p&gt;\n            &lt;/div1&gt;\n   \n   \n            &lt;div1 id=&quot;t17930109-2&quot; type=&quot;trialAccount&quot;&gt;\n               &lt;interp value=&quot;BAILEY&quot; type=&quot;collection&quot; inst=&quot;t17930109-2&quot;/&gt;\n               &lt;interp value=&quot;1793&quot; type=&quot;year&quot; inst=&quot;t17930109-2&quot;/&gt;\n               &lt;interp value=&quot;sessionsPapers/17930109&quot; type=&quot;uri&quot; inst=&quot;t17930109-2&quot;/&gt;\n               &lt;interp value=&quot;17930109&quot; type=&quot;date&quot; inst=&quot;t17930109-2&quot;/&gt;\n               &lt;join targets=&quot;t17930109-2-defend64 t17930109-2-off9 t17930109-2-verdict13&quot; targOrder=&quot;Y&quot; id=&quot;t17930109-2-off9-c61&quot; result=&quot;criminalCharge&quot;/&gt;\n         \n               &lt;p&gt;124. \n               \n                  &lt;persName type=&quot;defendantName&quot; id=&quot;t17930109-2-defend64&quot;&gt;\n                     CHARLES \n                     CRAWLEY\n                  &lt;interp value=&quot;CRAWLEY&quot; type=&quot;surname&quot; inst=&quot;t17930109-2-defend64&quot;/&gt;\n                     &lt;interp value=&quot;CHARLES&quot; type=&quot;given&quot; inst=&quot;t17930109-2-defend64&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-2-defend64&quot;/&gt;\n                     &lt;interp value=&quot;eleven years old and six months&quot; type=&quot;age&quot; inst=&quot;t17930109-2-defend64&quot;/&gt;\n                  &lt;/persName&gt;\n               \n             was indicted for &lt;rs type=&quot;offenceDescription&quot; id=&quot;t17930109-2-off9&quot;&gt;\n                     &lt;interp value=&quot;theft&quot; type=&quot;offenceCategory&quot; inst=&quot;t17930109-2-off9&quot;/&gt;\n                     &lt;interp value=&quot;shoplifting&quot; type=&quot;offenceSubcategory&quot; inst=&quot;t17930109-2-off9&quot;/&gt;\n               feloniously stealing, on the &lt;rs type=&quot;crimeDate&quot; id=&quot;t17930109-2-cd10&quot;&gt;31st of December&lt;/rs&gt;\n                     &lt;join targets=&quot;t17930109-2-off9 t17930109-2-cd10&quot; targOrder=&quot;Y&quot; result=&quot;offenceCrimeDate&quot;/&gt;, four silk handkerchiefs, value 15 s. the goods of \n                     \n                        &lt;persName type=&quot;victimName&quot; id=&quot;t17930109-2-victim66&quot;&gt;\n                           Harry \n                           Baker\n                        &lt;interp value=&quot;Baker&quot; type=&quot;surname&quot; inst=&quot;t17930109-2-victim66&quot;/&gt;\n                        &lt;interp value=&quot;Harry&quot; type=&quot;given&quot; inst=&quot;t17930109-2-victim66&quot;/&gt;\n                        &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-2-victim66&quot;/&gt;\n                        &lt;join targets=&quot;t17930109-2-off9 t17930109-2-victim66&quot; targOrder=&quot;Y&quot; result=&quot;offenceVictim&quot;/&gt;\n                     &lt;/persName&gt;\n                     \n                  , privately in his shop\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-2-person67&quot;&gt;\n                  WILLIAM\n                   ANDERSON\n               &lt;interp value=&quot;ANDERSON&quot; type=&quot;surname&quot; inst=&quot;t17930109-2-person67&quot;/&gt;\n                     &lt;interp value=&quot;WILLIAM&quot; type=&quot;given&quot; inst=&quot;t17930109-2-person67&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-2-person67&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;I am shopman to Mr. Baker, No. 12, &lt;placeName id=&quot;t17930109-2-crimeloc11&quot;&gt;Pall Mall&lt;/placeName&gt;\n                  &lt;interp value=&quot;Pall Mall&quot; type=&quot;placeName&quot; inst=&quot;t17930109-2-crimeloc11&quot;/&gt;\n                  &lt;interp value=&quot;crimeLocation&quot; type=&quot;type&quot; inst=&quot;t17930109-2-crimeloc11&quot;/&gt;\n                  &lt;join targets=&quot;t17930109-2-off9 t17930109-2-crimeloc11&quot; targOrder=&quot;Y&quot; result=&quot;offencePlace&quot;/&gt;, a &lt;rs type=&quot;occupation&quot; id=&quot;t17930109-2-viclabel12&quot;&gt;linen draper&lt;/rs&gt;\n                  &lt;join targets=&quot;t17930109-2-victim66 t17930109-2-viclabel12&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;/&gt;; there was another lad and him came into our shop, on the 31st of December last, about five o'clock, they asked for some worsted stockings, I shewed them some at 18 d. a pair, that the other boy thought too much and the prisoner took the handkerchiefs out of the window, they came in together, he stood close by the window; I did not see him take them; but before he came in there were handkerchiefs there; I am sure they were there at the time they came in; the handkerchiefs were close to the glass so as to be seen on the outside; as soon as ever they were gone I missed the handkerchiefs. The other boy said, he had no more than a shilling, and then they both ran away; I looked at the window directly and I found the handkerchiefs gone; I immediately pursued them; I saw which way they went, they turned to the left and went up Market-lane; I ran after them into the market, and I saw Crawley throw the handkerchiefs from under his coat under a dark window, when I was not three yards from him.&lt;/p&gt;\n               &lt;p&gt;Q. Could you see what he threw down? - No, I went and picked up what he threw down and laid hold of him; they were my handkerchiefs, and the person was the prisoner Crawley: I am quite sure that the boy I laid hold of in the street was the same boy who was in the shop by the window.&lt;/p&gt;\n               &lt;p&gt;Q. If I understand you right you did not see him take the handkerchiefs, but you knew they were there when he came in, and you missed them immediately as he went out? - It was so.&lt;/p&gt;\n               &lt;p&gt;Q. Was there any body else came in? - There was a woman came in before the boys went out, she stood at the same counter further on in the shop, she&lt;xptr doc=&quot;179301090006&quot; type=&quot;pageFacsimile&quot;/&gt;bought a pair of stockings but not of me.&lt;/p&gt;\n               &lt;p&gt;(The handkerchiefs produced and deposed to.)&lt;/p&gt;\n               &lt;p&gt;Prisoner. I am eleven years old; he took me out of St. James's-market and said, I stole the handkerchiefs; they stripped me naked and then they took and put marks on them; there were other boys running along besides me; I have a father and a mother, my mother carries loads in the market; I have no friends here now; I have been in prison a week or better.&lt;/p&gt;\n               &lt;p&gt;\n            \n                  &lt;persName id=&quot;t17930109-2-person68&quot;&gt;\n                  CATHARINE\n                   CRAWLEY\n               &lt;interp value=&quot;CRAWLEY&quot; type=&quot;surname&quot; inst=&quot;t17930109-2-person68&quot;/&gt;\n                     &lt;interp value=&quot;CATHARINE&quot; type=&quot;given&quot; inst=&quot;t17930109-2-person68&quot;/&gt;\n                     &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;t17930109-2-person68&quot;/&gt;\n                  &lt;/persName&gt;\n             sworn.&lt;/p&gt;\n               &lt;p&gt;This is my son; I don't know what to say about it, he left his master twice, he was with the philanthropic society; he does not live with me, and two boys in the street enticed him away; he is eleven years old and six months.&lt;/p&gt;\n               &lt;p&gt;\n                  &lt;rs type=&quot;verdictDescription&quot; id=&quot;t17930109-2-verdict13&quot;&gt;\n                     &lt;interp value=&quot;guilty&quot; type=&quot;verdictCategory&quot; inst=&quot;t17930109-2-verdict13&quot;/&gt;\n               GUILTY\n            &lt;/rs&gt;. &lt;rs type=&quot;punishmentDescription&quot; id=&quot;t17930109-2-punish14&quot;&gt;\n                     &lt;interp value=&quot;death&quot; type=&quot;punishmentCategory&quot; inst=&quot;t17930109-2-punish14&quot;/&gt;\n                     &lt;join targets=&quot;t17930109-2-defend64 t17930109-2-punish14&quot; targOrder=&quot;Y&quot; result=&quot;defendantPunishment&quot;/&gt;\n               Death\n            &lt;/rs&gt;.&lt;/p&gt;\n               &lt;p&gt;Tried by the first Middlesex Jury before the Lord CHIEF BARON.&lt;/p&gt;\n            &lt;/div1&gt;\n   \n   \n            &lt;div1 id=&quot;t17930109-3&quot; type=&quot;trialAccount&quot;&gt;\n               &lt;interp value=&quot;BAILEY&quot; type=&quot;collection&quot; inst=&quot;t17930109-3&quot;/&gt;\n               &lt;interp value=&quot;1793&quot; type=&quot;year&quot; inst=&quot;t17930109-3&quot;/&gt;\n               &lt;interp value=&quot;sessionsPapers/17930109&quot; type=&quot;uri&quot; inst=&quot;t17930109-3&quot;/&gt;\n               &lt;interp value=&quot;17930109&quot; type=&quot;date&quot; inst=&quot;t17930109-3&quot;/&gt;\n               &lt;join targets=&quot;t17930109-3-defend70 t17930109-3-off15 t17930109-3-verdict19&quot; targOrder=&quot;Y&quot; id=&quot;t17930109-3-off15-c65&quot; result=&quot;criminalCharge&quot;/&gt;\n         \n               &lt;p&gt;125. \n               \n                  &lt;persName type=&quot;defendantName&quot; id=&quot;t17930109-3-defend70&quot;&gt;\n                     JAMES \n                     FEILD\n                  &lt;interp value=&quot;FEILD&quot; type=&quot;surname&quot; inst=&quot;t17930109-3-defend70&quot;/&gt;\n                     &lt;interp value=&quot;JAMES&quot; type=&quot;given&quot; inst=&quot;t17930109-3-defend70&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;t17930109-3-defend70&quot;/&gt;\n                  &lt;/persName&gt;\n               \n             was indicted for &lt;rs type=&quot;offenceDescription&quot; id=&quot;t17930109-3-off15&quot;&gt;\n                     &lt;interp value=&quot;theft&quot; type=&quot;offenceCategory&quot; inst=&quot;t17930109-3-off15&quot;/&gt;\n                     &lt;interp value=&quot;burglary&quot; type=&quot;offenceSubcategory&quot; inst=&quot;t17930109-3-off15&quot;/&gt;\n               feloniously and burglariously breaking and entering the house of \n                     \n                        &lt;persName type=&quot;victimName&quot; id=&quot;t17930109-3-victim72&quot;&gt;\n                           Robert \n                ...</div>","arguments":{},"addedWidgets":{},"removedWidgets":[]},"errorSummary":null,"error":null,"startTime":1.461711255502E12,"submitTime":1.461711115341E12,"finishTime":1.461711255791E12,"collapsed":false,"bindings":{},"inputWidgets":{},"displayType":"table","width":"auto","height":"auto","xColumns":null,"yColumns":null,"pivotColumns":null,"pivotAggregation":null,"customPlotOptions":{},"commentThread":[],"commentsVisible":false,"parentHierarchy":[],"diffInserts":[],"diffDeletes":[],"globalVars":{},"latestUser":"r.sainudiin@math.canterbury.ac.nz","commandTitle":"","showCommandTitle":false,"hideCommandCode":false,"hideCommandResult":false,"iPythonMetadata":null,"nuid":"48e15066-0a1d-44f1-a627-ec312a61304b"},{"version":"CommandV1","origId":105398,"guid":"cb544e66-8efb-4992-bc72-1a42d444ea6d","subtype":"command","commandType":"auto","position":1.49365234375,"command":"elem","commandVersion":0,"state":"finished","results":{"type":"html","data":"<div class=\"ansiout\">res54: scala.xml.Elem = \n&lt;TEI.2&gt;\n   &lt;text&gt;\n      &lt;body&gt;\n         &lt;div0 id=&quot;17930109&quot; type=&quot;sessionsPaper&quot;&gt;\n            &lt;interp value=&quot;BAILEY&quot; type=&quot;collection&quot; inst=&quot;17930109&quot;/&gt;\n            &lt;interp value=&quot;1793&quot; type=&quot;year&quot; inst=&quot;17930109&quot;/&gt;\n            &lt;interp value=&quot;sessionsPapers/17930109&quot; type=&quot;uri&quot; inst=&quot;17930109&quot;/&gt;\n            &lt;interp value=&quot;17930109&quot; type=&quot;date&quot; inst=&quot;17930109&quot;/&gt;\n            &lt;xptr doc=&quot;17930109&quot; type=&quot;tran ender&quot; inst=&quot;f17930109-1-person2&quot;/&gt;\n                  &lt;/persName&gt;\n             OF THE CITY OF LONDON.&lt;/p&gt;\n               &lt;p&gt;TAKEN IN SHORT-HAND BY MANOAH SIBLY, PROFESSOR OF SHORT-HAND, No. 35, Goswell-Street, And Published by Authority.&lt;/p&gt;\n               &lt;p&gt;NUMBER II. PART I.&lt;/p&gt;\n               &lt;p&gt;LONDON:&lt;/p&gt;\n               &lt;p&gt;Printed and published by \n               &lt;persName id=&quot;f17930109-1-person3&quot;&gt;\n                  HENRY\n                   FENWICK\n               &lt;interp value=&quot;FENWICK&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person3&quot;/&gt;\n                     &lt;interp value=&quot;HENRY&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person3&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person3&quot;/&gt;\n                  &lt;/persName&gt;\n            , No. 63, Snow Hill.&lt;/p&gt;\n               &lt;p&gt;[PRICE ONE SHILLING and FOUR-PENCE.]&lt;/p&gt;\n               &lt;p&gt;\n                  &lt;xptr doc=&quot;179301090002&quot; type=&quot;pageFacsimile&quot;/&gt;THE WHOLE PROCEEDINGS ON THE&lt;/p&gt;\n               &lt;p&gt;KING's Commission of the Peace, Oyer and Terminer, and Gaol Delivery for the CITY of LONDON, &amp;amp;c.&lt;/p&gt;\n               &lt;p&gt;BEFORE the Right Honourable SIR \n               \n                  &lt;persName type=&quot;judiciaryName&quot; id=&quot;f17930109-1-person4&quot;&gt;\n                     JAMES\n                      SANDERSON\n                  &lt;interp value=&quot;SANDERSON&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person4&quot;/&gt;\n                     &lt;interp value=&quot;JAMES&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person4&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person4&quot;/&gt;\n                  &lt;/persName&gt;\n               , KNT. LORD MAYOR of the CITY of LONDON; the Right Honourable Sir \n                  &lt;persName type=&quot;judiciaryName&quot; id=&quot;f17930109-1-person5&quot;&gt;\n                     JAMES\n                      EYRE\n                  &lt;interp value=&quot;EYRE&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person5&quot;/&gt;\n                     &lt;interp value=&quot;JAMES&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person5&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person5&quot;/&gt;\n                  &lt;/persName&gt;\n               , LORD CHIEF BARON of his Majesty's Court of Exchequer; the Right Honourable SIR \n                  &lt;persName type=&quot;judiciaryName&quot; id=&quot;f17930109-1-person6&quot;&gt;\n                     FRANCIS\n                      BULLER\n                  &lt;interp value=&quot;BULLER&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person6&quot;/&gt;\n                     &lt;interp value=&quot;FRANCIS&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person6&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person6&quot;/&gt;\n                  &lt;/persName&gt;\n               , one of the Justices of his Majesty's Court of King's Bench; the Honourable SIR \n                  &lt;persName type=&quot;judiciaryName&quot; id=&quot;f17930109-1-person7&quot;&gt;\n                     JOHN\n                      WILSON\n                  &lt;interp value=&quot;WILSON&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person7&quot;/&gt;\n                     &lt;interp value=&quot;JOHN&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person7&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person7&quot;/&gt;\n                  &lt;/persName&gt;\n               , one of the Justices of his Majesty's Court of Common Pleas; Sir \n                  &lt;persName type=&quot;judiciaryName&quot; id=&quot;f17930109-1-person8&quot;&gt;\n                     JOHN\n                      WILLIAM\n                  &lt;interp value=&quot;WILLIAM&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person8&quot;/&gt;\n                     &lt;interp value=&quot;JOHN&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person8&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person8&quot;/&gt;\n                  &lt;/persName&gt;\n                ROSE, Serjeant at Law, Recorder of the said City: \n                  &lt;persName type=&quot;judiciaryName&quot; id=&quot;f17930109-1-person9&quot;&gt;\n                     JOHN\n                      SILVESTER\n                  &lt;interp value=&quot;SILVESTER&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person9&quot;/&gt;\n                     &lt;interp value=&quot;JOHN&quot; type=&quot;given&quot; inst=&quot;f17930109-1-person9&quot;/&gt;\n                     &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;f17930109-1-person9&quot;/&gt;\n                  &lt;/persName&gt;\n               , Esq. Common Serjeant at Law of the said City; and others, His Majesty's Justices of Oyer and Terminer of the CITY of LONDON, and Justices of Gaol Delivery of NEWGATE, holden for the said City and County of MIDDLESEX.&lt;/p&gt;\n         \n               &lt;p&gt;First Middlesex Jury.&lt;/p&gt;\n               &lt;p&gt;\n               \n                  &lt;persName type=&quot;jurorName&quot; id=&quot;f17930109-1-person10&quot;&gt;\n                     William\n                      Bailey\n                  &lt;interp value=&quot;Bailey&quot; type=&quot;surname&quot; inst=&quot;f17930109-1-person10&quot;/&gt;\n                     &lt;interp value=&quot;William&quot; type=&quot;given&quot; inst=&quot;f1793010
