Terminer, and Jail-Delivery of Newgate, held (before the\n          &lt;persName id=&quot;OA17261103n3-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n3-1&quot;/&gt;\n            &lt;interp value=&quot;FORBES&quot; type=&quot;surname&quot; inst=&quot;OA17261103n3-1&quot;/&gt;\n            &lt;interp value=&quot;FRANCIS&quot; type=&quot;given&quot; inst=&quot;OA17261103n3-1&quot;/&gt;\n            Right Honourable Sir FRANCIS FORBES\n          &lt;/persName&gt;\n          ,\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-1&quot;&gt;Knt&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n3-1 OA17261103-occupation-1&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          .\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-2&quot;&gt;Lord Mayor&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n3-1 OA17261103-occupation-2&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          of the\n          &lt;placeName id=&quot;OA17261103-geo-1&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-1&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n3-1 OA17261103-geo-1&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            City of London\n          &lt;/placeName&gt;\n          , the Honourable the Lord Chief Justice Raymond, the Honourable Mr. Baron Price,\n          &lt;persName id=&quot;OA17261103n3-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n3-2&quot;/&gt;\n            &lt;interp value=&quot;RABY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n3-2&quot;/&gt;\n            &lt;interp value=&quot;JOHN&quot; type=&quot;given&quot; inst=&quot;OA17261103n3-2&quot;/&gt;\n            John Raby\n          &lt;/persName&gt;\n          ,\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-3&quot;&gt;Serjeant at Law&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n3-2 OA17261103-occupation-3&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          , and other his Majesty's Justices of Jail Delivery, and Oyer and Terminer aforesaid, together with his Majesty's Justices of the Peace for the said City of London, and County of Middlesex) at Justice-Hall in the\n          &lt;placeName id=&quot;OA17261103-geo-2&quot;&gt;\n            &lt;interp value=&quot;site&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-2&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n3-1 n3-2 n4-1 n4-2 n4-3 n4-4 n4-5 n4-6 n4-7 OA17261103-geo-2&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Old-Baily\n          &lt;/placeName&gt;\n          , on Wednesday, Thursday, Friday, and Saturday, being the 12th, 13th, 14th, and 15th of October, 1726, in the Thirteenth Year of his Majesty's Reign.\n        &lt;/p&gt;\n        &lt;p&gt;\n          Eight Persons, viz.\n          &lt;persName id=&quot;OA17261103n4-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-1&quot;/&gt;\n            &lt;interp value=&quot;JONES&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-1&quot;/&gt;\n            &lt;interp value=&quot;HENRY&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-1&quot;/&gt;\n            Henry Jones\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n4-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-2&quot;/&gt;\n            &lt;interp value=&quot;SMITH&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-2&quot;/&gt;\n            &lt;interp value=&quot;JOSEPH&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-2&quot;/&gt;\n            Joseph Smith\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n4-3&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-3&quot;/&gt;\n            &lt;interp value=&quot;MARJORAM&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-3&quot;/&gt;\n            &lt;interp value=&quot;WILLIAM&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-3&quot;/&gt;\n            William Marjoram\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n4-4&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-4&quot;/&gt;\n            &lt;interp value=&quot;ROSE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-4&quot;/&gt;\n            &lt;interp value=&quot;ROBERT&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-4&quot;/&gt;\n            Robert Rose\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n4-5&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-5&quot;/&gt;\n            &lt;interp value=&quot;DRURY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-5&quot;/&gt;\n            &lt;interp value=&quot;ANTHONY&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-5&quot;/&gt;\n            Anthony Drury\n          &lt;/persName&gt;\n          , Matthew Harday, and\n          &lt;persName id=&quot;OA17261103n4-6&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-6&quot;/&gt;\n            &lt;interp value=&quot;HIDE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-6&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-6&quot;/&gt;\n            Thomas Hide\n          &lt;/persName&gt;\n          , and one Woman,\n          &lt;persName id=&quot;OA17261103n4-7&quot;&gt;\n            &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;OA17261103n4-7&quot;/&gt;\n            &lt;interp value=&quot;Sattarfield&quot; type=&quot;surname&quot; inst=&quot;OA17261103n4-7&quot;/&gt;\n            &lt;interp value=&quot;Sarah&quot; type=&quot;given&quot; inst=&quot;OA17261103n4-7&quot;/&gt;\n            Sarah Sattarfield\n          &lt;/persName&gt;\n          , were convicted of capital Offences, and received Sentence of Death accordingly.\n        &lt;/p&gt;\n        &lt;p&gt;\n          While under Sentence, these who attended in Chapel, to outward appearance, seem'd to be very serious and attentive both to the Prayers and Exhortations,\n          &lt;persName id=&quot;OA17261103n5-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-1&quot;/&gt;\n            &lt;interp value=&quot;DRURY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-1&quot;/&gt;\n            &lt;interp value=&quot;ANTHONY&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-1&quot;/&gt;\n            Anthony Drury\n          &lt;/persName&gt;\n          frequently showing his great Concern, as if he had been in agonies of Mind, Marjoram also being at all Times mightily affected, as was\n          &lt;persName id=&quot;OA17261103n5-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-2&quot;/&gt;\n            &lt;interp value=&quot;HARDY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-2&quot;/&gt;\n            &lt;interp value=&quot;MATTHEW&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-2&quot;/&gt;\n            Matthew Hardy\n          &lt;/persName&gt;\n          , tho' he had pretty good assurances of a Reprieve or Pardon; the other two,\n          &lt;persName id=&quot;OA17261103n5-3&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-3&quot;/&gt;\n            &lt;interp value=&quot;SMITH&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-3&quot;/&gt;\n            &lt;interp value=&quot;JOSEPH&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-3&quot;/&gt;\n            Joseph Smith\n          &lt;/persName&gt;\n          and\n          &lt;persName id=&quot;OA17261103n5-4&quot;&gt;\n            &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-4&quot;/&gt;\n            &lt;interp value=&quot;SATTERFIELD&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-4&quot;/&gt;\n            &lt;interp value=&quot;SARAH&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-4&quot;/&gt;\n            Sarah Satterfield\n          &lt;/persName&gt;\n          were a little more Hard-hearted;\n          &lt;persName id=&quot;OA17261103n5-5&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-5&quot;/&gt;\n            &lt;interp value=&quot;JONES&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-5&quot;/&gt;\n            &lt;interp value=&quot;HENRY&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-5&quot;/&gt;\n            Henry Jones\n          &lt;/persName&gt;\n          , when present, wanted not outward signs of Devotion, but most part of the time he was confin'd in the Hold, by reason of Weakness and Indisposition, inclining also to the\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-4&quot;&gt;Roman Catholick&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n5-5 OA17261103-occupation-4&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          Principles;\n          &lt;persName id=&quot;OA17261103n5-6&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-6&quot;/&gt;\n            &lt;interp value=&quot;ROSE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-6&quot;/&gt;\n            &lt;interp value=&quot;ROBERT&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-6&quot;/&gt;\n            Robert Rose\n          &lt;/persName&gt;\n          , an infirm, old Man, till the Report was made, came not to Chapel but once or twice, being constantly afflicted (as he said) with heavy Sickness, but declar'd himself very penitent, ingenuously confessing his Faults and Crimes, when I visited them in the Hold; As did also\n          &lt;persName id=&quot;OA17261103n5-7&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n5-7&quot;/&gt;\n            &lt;interp value=&quot;HIDE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n5-7&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n5-7&quot;/&gt;\n            Thomas Hide\n          &lt;/persName&gt;\n          , who on the Monday, being the second Day after his Sentence, fell into a violent high Fever, and lost his Senses, yet when I visited him in this miserable Condition in the Hold, altho' he did not know me at first, yet as I was praying for him, recovering his Senses a little, he comply'd with the Worship, and as I was going away he express'd his gratitude, by praying God to bless me twice or thrice, not being able to speak any more; and the same Night at Midnight, after he had praised God by singing Psalms, and making Responses in the Devotion, as in a recommendatory Prayer for him they were praying the Lord Jesus to receive his Soul, and at these Words (as I was told) he gave up the Ghost, being Thursday the 21st of October.\n        &lt;/p&gt;\n        &lt;p&gt;\n          I instructed them from Col. 2. 6. As ye have therefore received Christ Jesus the Lord, so walk ye in him. From which Text I took occasion to explain to them the necessity of Faith in Christ, which must not be a dead Faith, but attended with good Works, bringing forth manifold Fruits unto new obedience, Holyness and Virtue, not consisting in empty speculative Notions, as some seem to explain it, but affecting the heart with Heavenly divine Thoughts, truly becoming God and Religion, and making reformation upon the whole Man, so that he becomes wholly a new Creature, Holy in Heart and Life, dedicating himself without Reserve, Soul and Body, unto the Service of God. From Acts, 3, 19. Repent ye therefore and be converted, that your Sins may be blotted out, when the times of refreshing shall come from the presence of the Lord; they were taught the nature of true Repentance, which consisteth partly in an hearty unfeign'd Sorrow for Sin, not because of the Inconveniences and Calamities it brings upon us; but because of the Offence thereby given to Almighty God, in whom it is we live, move, and from whom we have all our Being, who is daily loading us with his Benefits, and preventing us with his Blessings; and therefore should we be grieved because we have offended our good and gracious God, such a tender, loving, and indulgent Father: But I show'd 'em that true Repentance mainly consisted in forsaking all Sin without exception, especially those Sins which are more heinous in the sight of God than others, and for which Men void of Virtue and goodness commonly come to Shame and Disgrace;\n        &lt;/p&gt;\n        &lt;xptr doc=&quot;OA172611030002&quot; type=&quot;pageFacsimile&quot;/&gt;\n        &lt;p&gt;\n          and as by Repentance they must forsake Sin, so as to loath, detest and abhor themselves in Dust and Ashes because of it; and told them, that they must turn to God with all their Heart, whereas formerly they had been the Servants of Sin unto Unrighteousness, henceforth they must become the obedient Servants of Righteousness unto Holiness, approving 'emselves with Consciences void of Offence towards God and towards Man; and resolving by the Grace of God, if they had been to continue any longer in this World, to become new Creatures, having their Conversation in Heaven, looking unto Jesus the Author and finisher of our Faith, &amp;amp;c. They were also instructed in the nature of the Christian Sacraments; and how greatly they had been guilty of breaking their baptismal Vows, particularly, in committing those heinous Sins, of robbing other Men of their Goods and Properties, which now brought them into much Shame, and loaded 'em with many Sorrows and anguish of Mind: I exhorted them to prepare for receiving the Sacrament of the Lord's Supper, as a Pledge and assurance of their coming to everlasting Life, if they sincerely repented of all their Sins, believing in our Lord Jesus Christ their only Saviour; and from these Words, St. Luke 22. 19. This do in Remembrance of me, &amp;amp;c.\n        &lt;/p&gt;\n        &lt;p&gt;\n          Upon Tuesday the 25th of October, the Report of the Eight Malefactors under Sentence of Death was made to his Majesty in Council, when (\n          &lt;persName id=&quot;OA17261103n8-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-1&quot;/&gt;\n            &lt;interp value=&quot;HIDE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-1&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-1&quot;/&gt;\n            Thomas Hide\n          &lt;/persName&gt;\n          , being dead in the Hold some Days before the Report was made) five of them receiv'd his Majesty's most gracious Reprieve, viz.\n          &lt;persName id=&quot;OA17261103n8-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-2&quot;/&gt;\n            &lt;interp value=&quot;JONES&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-2&quot;/&gt;\n            &lt;interp value=&quot;HENRY&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-2&quot;/&gt;\n            Henry Jones\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n8-3&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-3&quot;/&gt;\n            &lt;interp value=&quot;MARJORAM&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-3&quot;/&gt;\n            &lt;interp value=&quot;WILLIAM&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-3&quot;/&gt;\n            William Marjoram\n          &lt;/persName&gt;\n          , alias\n          &lt;persName id=&quot;OA17261103n8-8&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-8&quot;/&gt;\n            &lt;interp value=&quot;HUGGIDIE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-8&quot;/&gt;\n            &lt;interp value=&quot;WILLIAM&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-8&quot;/&gt;\n            Huggidie\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n8-4&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-4&quot;/&gt;\n            &lt;interp value=&quot;ROSE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-4&quot;/&gt;\n            &lt;interp value=&quot;ROBERT&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-4&quot;/&gt;\n            Robert Rose\n          &lt;/persName&gt;\n          ,\n          &lt;persName id=&quot;OA17261103n8-5&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-5&quot;/&gt;\n            &lt;interp value=&quot;HARDY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-5&quot;/&gt;\n            &lt;interp value=&quot;MATTHEW&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-5&quot;/&gt;\n            Matthew Hardy\n          &lt;/persName&gt;\n          , and\n          &lt;persName id=&quot;OA17261103n8-6&quot;&gt;\n            &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-6&quot;/&gt;\n            &lt;interp value=&quot;SATTERFIELD&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-6&quot;/&gt;\n            &lt;interp value=&quot;SARAH&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-6&quot;/&gt;\n            Sarah Satterfield\n          &lt;/persName&gt;\n          ; the remaining two, viz.\n          &lt;persName id=&quot;OA17261103n8-7&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-7&quot;/&gt;\n            &lt;interp value=&quot;DRURY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-7&quot;/&gt;\n            &lt;interp value=&quot;ANTHONY&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-7&quot;/&gt;\n            Anthony Drury\n          &lt;/persName&gt;\n          , and\n          &lt;persName id=&quot;OA17261103n8-9&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n8-9&quot;/&gt;\n            &lt;interp value=&quot;Smith&quot; type=&quot;surname&quot; inst=&quot;OA17261103n8-9&quot;/&gt;\n            &lt;interp value=&quot;Joseph&quot; type=&quot;given&quot; inst=&quot;OA17261103n8-9&quot;/&gt;\n            Joseph Jmith\n          &lt;/persName&gt;\n          , were ordered for Execution. Which two, when they saw that all hopes of a Reprieve was past, prepar'd themselves for Death with the utmost application, as one who is a Stranger to their inward disposition of their Hearts and Minds, could possibly in Charity judge of them. The subsequent brief Narrations is for information of those who desire to know any thing further about their last Confessions and Behaviour.\n        &lt;/p&gt;\n        &lt;p&gt;\n          &lt;persName id=&quot;OA17261103n9-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n9-1&quot;/&gt;\n            &lt;interp value=&quot;SMITH&quot; type=&quot;surname&quot; inst=&quot;OA17261103n9-1&quot;/&gt;\n            &lt;interp value=&quot;JOSEPH&quot; type=&quot;given&quot; inst=&quot;OA17261103n9-1&quot;/&gt;\n            Joseph Smith\n          &lt;/persName&gt;\n          was Indicted for privately stealing from\n          &lt;persName id=&quot;OA17261103n9-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n9-2&quot;/&gt;\n            &lt;interp value=&quot;COLLIER&quot; type=&quot;surname&quot; inst=&quot;OA17261103n9-2&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n9-2&quot;/&gt;\n            Thomas Collier\n          &lt;/persName&gt;\n          , a Coat an Waistcoat, val. 30 s. a Hat, a pair of Silver-Buckles, a Handkerchief, a pair of Gloves, a Tobacco-box, a Knife and Fork, Half a Guinea, and 25 s. on the 2d of August, and found Guilty by the Jury.\n        &lt;/p&gt;\n        &lt;p&gt;\n          &lt;persName id=&quot;OA17261103n10-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n10-1&quot;/&gt;\n            &lt;interp value=&quot;SMITH&quot; type=&quot;surname&quot; inst=&quot;OA17261103n10-1&quot;/&gt;\n            &lt;interp value=&quot;JOSEPH&quot; type=&quot;given&quot; inst=&quot;OA17261103n10-1&quot;/&gt;\n            Joseph Smith\n          &lt;/persName&gt;\n          (whose true Name, as he declar'd, was\n          &lt;persName id=&quot;OA17261103n10-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n10-2&quot;/&gt;\n            &lt;interp value=&quot;SHREWSBURY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n10-2&quot;/&gt;\n            &lt;interp value=&quot;JOSEPH&quot; type=&quot;given&quot; inst=&quot;OA17261103n10-2&quot;/&gt;\n            Joseph Shrewsbury\n          &lt;/persName&gt;\n          ) about 22 Years of Age, as he said, Born at\n          &lt;placeName id=&quot;OA17261103-geo-3&quot;&gt;\n            &lt;interp value=&quot;county&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-3&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n10-1 n10-2 OA17261103-geo-3&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            &lt;placeName id=&quot;OA17261103-geo-4&quot;&gt;\n              &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-4&quot;/&gt;\n              &lt;join \n              targets=&quot;OA17261103n10-1 n10-2 OA17261103-geo-4&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n              Watford\n            &lt;/placeName&gt;\n            in Hertfordshire\n          &lt;/placeName&gt;\n          , descended of honest Parents, who were poor, mean People, and not capable to give him Education at School, having a numerous Family of ten or eleven Children; yet (as he said) they gave him the good example of a virtuous Life, taking him to Church, and giving opportunity of attaining the knows ledge of Christian Principles and Practices, if his own dispositions had been correspondent to their Instructions and Example. When of Age, they put him out\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-5&quot;&gt;Apprentice to a Tanner&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n10-1 n10-2 OA17261103-occupation-5&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          , who was a very good and discreet Master in the Place of his Nativity, with whom he stay'd for some Years, but neglected his Business to such a Degree, being, (as he confest) addicted to Dancing, that he cou'd by no means abstain from it, although otherways not at all inclin'd to, or guilty of Robbery or Thieving) that his Master was forc'd to put him away: He acknowledg'd that he liv'd in good Circumstances, if he had not been unthankful to God and Man, for the happy State he was in, by taking himself to bad Company, which prov'd the occasion of his fatal end. As to the particular Fact for which he Suffer'd, he said it was the first Robbery he ever committed, and that one\n          &lt;persName id=&quot;OA17261103n10-3&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n10-3&quot;/&gt;\n            &lt;interp value=&quot;ANDERSON&quot; type=&quot;surname&quot; inst=&quot;OA17261103n10-3&quot;/&gt;\n            &lt;interp value=&quot;DAVID&quot; type=&quot;given&quot; inst=&quot;OA17261103n10-3&quot;/&gt;\n            David Anderson\n          &lt;/persName&gt;\n          , Country Will and\n          &lt;persName id=&quot;OA17261103n10-4&quot;&gt;\n            &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;OA17261103n10-4&quot;/&gt;\n            &lt;interp value=&quot;AUSTIN&quot; type=&quot;surname&quot; inst=&quot;OA17261103n10-4&quot;/&gt;\n            &lt;interp value=&quot;JENNY&quot; type=&quot;given&quot; inst=&quot;OA17261103n10-4&quot;/&gt;\n            Jenny Austin\n          &lt;/persName&gt;\n          strip't\n          &lt;persName id=&quot;OA17261103n10-5&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n10-5&quot;/&gt;\n            &lt;interp value=&quot;COLLIER&quot; type=&quot;surname&quot; inst=&quot;OA17261103n10-5&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n10-5&quot;/&gt;\n            Thomas Collier\n          &lt;/persName&gt;\n          of his Cloaths, and took his Money from him, while he was at a distance from them, delivering him the Coat, Wastcoat, and other things which were found upon him. He confess'd he had been a great Sinner, and that his Sentence was just, and that he died in Peace with all the World, freely forgiving all Men as he expected forgiveness at the hands of God, begging Pardon of all whom he had injur'd, and declaring that he died in Communion of this Church, of which he own'd himself an unworthy Member.\n        &lt;/p&gt;\n        &lt;p&gt;\n          &lt;persName id=&quot;OA17261103n11-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-1&quot;/&gt;\n            &lt;interp value=&quot;DRURY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-1&quot;/&gt;\n            &lt;interp value=&quot;ANTHONY&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-1&quot;/&gt;\n            Anthony Drury\n          &lt;/persName&gt;\n          , of the Parish of\n          &lt;placeName id=&quot;OA17261103-geo-5&quot;&gt;\n            &lt;interp value=&quot;parish&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-5&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n11-1 OA17261103-geo-5&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Eling\n          &lt;/placeName&gt;\n          , was Indicted for assaulting\n          &lt;persName id=&quot;OA17261103n11-2&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-2&quot;/&gt;\n            &lt;interp value=&quot;ELDRIGE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-2&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-2&quot;/&gt;\n            Thomas Eldrige\n          &lt;/persName&gt;\n          on the Highway, putting him in fear, and taking from him a Bag, value 2d, a Fan, val. 1 s. a Hamper, val. 6d, 15 Moidores, 210 Guineas, and 80 half Guineas, the Goods and Money of Mr. Burrows, Sept. 25th. He was a 2d, time Indicted for assaulting\n          &lt;persName id=&quot;OA17261103n11-6&quot;&gt;\n            &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-6&quot;/&gt;\n            &lt;interp value=&quot;KING&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-6&quot;/&gt;\n            &lt;interp value=&quot;SARAH&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-6&quot;/&gt;\n            Sarah\n          &lt;/persName&gt;\n          the\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-6&quot;&gt;Wife&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n11-6 OA17261103-occupation-6&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          of\n          &lt;persName id=&quot;OA17261103n11-7&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-7&quot;/&gt;\n            &lt;interp value=&quot;King&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-7&quot;/&gt;\n            &lt;interp value=&quot;Robert&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-7&quot;/&gt;\n            Robert King\n          &lt;/persName&gt;\n          on the Highway, and robing her of two Shillings and six pence. He was the 3d, time indicted for assaulting\n          &lt;persName id=&quot;OA17261103n11-3&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-3&quot;/&gt;\n            &lt;interp value=&quot;ELDRIGE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-3&quot;/&gt;\n            &lt;interp value=&quot;THOMAS&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-3&quot;/&gt;\n            Thomas Eldrige\n          &lt;/persName&gt;\n          on the Highway, and taking a Callicoe Gown and Petticoat, val. 20s. the Goods of\n          &lt;persName id=&quot;OA17261103n11-4&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-4&quot;/&gt;\n            &lt;interp value=&quot;BETTS&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-4&quot;/&gt;\n            &lt;interp value=&quot;GILES&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-4&quot;/&gt;\n            Giles Betts\n          &lt;/persName&gt;\n          . He was a 4th, time indicted for assaulting\n          &lt;persName id=&quot;OA17261103n11-8&quot;&gt;\n            &lt;interp value=&quot;female&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-8&quot;/&gt;\n            &lt;interp value=&quot;PAGE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-8&quot;/&gt;\n            &lt;interp value=&quot;MARY&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-8&quot;/&gt;\n            Mary\n          &lt;/persName&gt;\n          the\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-7&quot;&gt;Wife&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n11-8 OA17261103-occupation-7&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          of\n          &lt;persName id=&quot;OA17261103n11-5&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n11-5&quot;/&gt;\n            &lt;interp value=&quot;PAGE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n11-5&quot;/&gt;\n            &lt;interp value=&quot;JOSEPH&quot; type=&quot;given&quot; inst=&quot;OA17261103n11-5&quot;/&gt;\n            Joseph Page\n          &lt;/persName&gt;\n          on the Highway, and forcibly taking from her 2 s. and 6d, For the three first Indictments the Jury brought him in Guilty of Death.\n        &lt;/p&gt;\n        &lt;p&gt;\n          &lt;persName id=&quot;OA17261103n12-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n12-1&quot;/&gt;\n            &lt;interp value=&quot;DRURY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n12-1&quot;/&gt;\n            &lt;interp value=&quot;ANTHONY&quot; type=&quot;given&quot; inst=&quot;OA17261103n12-1&quot;/&gt;\n            Anthony Drury\n          &lt;/persName&gt;\n          , as he said about 28 Years of Age, Descended of honest Parents, who were People of Credit and Reputation, and gave him good Education for Business, and instructed him in the knowledge of the Principles of Christianity; but did not (as he alledg'd) put him to any particular Employment, having left him in pretty good Circumstances. He liv'd at several Places, after he left a Country-place in\n          &lt;placeName id=&quot;OA17261103-geo-6&quot;&gt;\n            &lt;interp value=&quot;county&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-6&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-6&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Norfolk\n          &lt;/placeName&gt;\n          where he was Born, particularly in the\n          &lt;placeName id=&quot;OA17261103-geo-7&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-7&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-7&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            City of Oxford\n          &lt;/placeName&gt;\n          , at Bister, and at\n          &lt;placeName id=&quot;OA17261103-geo-8&quot;&gt;\n            &lt;interp value=&quot;county&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-8&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-8&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            &lt;placeName id=&quot;OA17261103-geo-9&quot;&gt;\n              &lt;join \n              targets=&quot;OA17261103n12-1 OA17261103-geo-9&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n              Wandover\n            &lt;/placeName&gt;\n            , in Buckinghamshire\n          &lt;/placeName&gt;\n          , where he resided and kept House, when\n        &lt;/p&gt;\n        &lt;xptr doc=&quot;OA172611030003&quot; type=&quot;pageFacsimile&quot;/&gt;\n        &lt;p&gt;\n          he committed the Robbery, for which he was taken, and for which he was Executed. Altho' he was not bred to any Employment, yet he said, that he understood\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-8&quot;&gt;Bricklaying&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n12-1 OA17261103-occupation-8&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          ; and that a certain Gentleman inform'd him in a Secret of curing Smoaky Chimneys, by which Practice he gain'd Considerable; and this was the Reason why he commonly past under the Nick-name of the Chimney Smoaky Doctor. He said that his Father left an Estate of one or two hundred pounds a Year to him, but the Truth of this may be doubted, since none of his Acquaintance who came to Visit him knew of any such Estate; but own'd that he liv'd in very good Credit, and that he was capable to make very considerable Profits of\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-9&quot;&gt;curing Chimneys&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n12-1 OA17261103-occupation-9&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          from Smoaking, which was his Profession, and in doing whereof he was very dexterous. Some few Years ago, he married a Widow Gentlewoman at\n          &lt;placeName id=&quot;OA17261103-geo-10&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-10&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-10&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Oxford\n          &lt;/placeName&gt;\n          , who had an Estate and Money, to the value of fifteen hundred Pounds, as is commonly reported by them who know him; but he said, that all the Fortune he got by her did not exceed 500 l. He said, that till this Misfortune for which he Died, his Credit and Honesty was never doubted, he living in as good a Character, as most Men in his Neighbourhood did. He appear'd to be a young Man of indifferent good Understanding, and of a pliable, civil Temper. In Chappel he seem'd always very Devout in Prayer, and attentive to what Exhortations were given them, and when I saw him in his Room, he was still employ'd in reading upon some Book of Devotion, having had the use of some few little Books very proper for his perusal, in order to prepare him for Death, while he was under Sentence. Both before and after the Report was made, he us'd all possible Means for obtaining a Reprieve, the Thoughts of which, mightily disturb'd and distracted his Mind in preparing for Eternity; and altho' Intercession was made by Men of eminent Note, yet his Crime was look'd upon to be so Heinous, that no Favour could be obtain'd that way; and then two days before his Death, he began to give over all Thoughts of Life, and to be more serious in preparing for Eternity; and to think upon receiving the Sacrament, which was accordingly Administred to him by a Rev. Clergyman, who was so good as to Visit him, and the rest of them sometimes, during their miserable Confinement; and before the Sacrament was given him, he gave a free Declaration of his Faith, and that he was in Peace, and Friendship with all Mankind. For he had frequently made grievous Complaints upon his Wife, calling her unnatural and cruel to him, in neither visiting nor writing to him in the Day of his extreme Calamity. He did indeed write to her himself, as did some others upon his desire, most earnestly desiring her to come to Town, and confer with him about some Affairs before his Death, and to see if she with the assistance of a Gentleman, whom he desir'd to come up with her, could do any thing in order to obtain a Reprieve. This he most earnestly urg'd upon her to do, but she sent no Answer to him; only the Gentleman whom he desir'd to come along with her, sent a Letter to him, making excuse both for Mrs. Drury's, and his own not coming to Town; that she was extremely Lame, and her Servant being gone could not put on her own Cloaths; that she had no Money o bear her Expences in such a Journey, much less to supply him in his Distress; and that it was no ways in her Power to do any thing for him: And as for the Gentleman himself, he said, that ever since he was in Town last attending him, he had been very much indispos'd of a violent Cold, contracted while he was at London, doing what he could for him, and all to no purpose, and going into the Country in a hurry about his own necessary Affairs. Mr. Drury among other Motives to induce his Wife to come to Town, desir'd her not to neglect to do it, that she might redeem some silver Plate which he had Pawn'd here in Town, for 24 l. to relieve himself in his pressing Necessities when in Prison at\n          &lt;placeName id=&quot;OA17261103-geo-11&quot;&gt;\n            &lt;interp value=&quot;site&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-11&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-11&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Newgate\n          &lt;/placeName&gt;\n          , altho' the Plate was worth more than double the Sum which was lent upon it. This Argument had no more force than the rest, she answering by her Friend's Letter, that if any Man would relieve the Plate, she would re-pay him, and gratify him sufficiently for his Trouble. Mr. Drury concluded that his Wife was not willing he should Live, but, as he said, he frankly and from his Heart forgave her. As to the Crime for which he Suffer'd, he said, that he never was a wicked Liver, but had follow'd his Business in an honest way, in working about Chimneys up and down the Country, which he found beneficial; altho' his Wife thinking it Dishonourable and Reproachful, did what she could to persuade and hinder him from following it. He complain'd indeed, that his Marriage being unequal as to Age, was an uncomfortable State of Life to him, his Wife having been of a fretful uneasie Temper, and perpetually Jealous of him without any just Cause.\n        &lt;/p&gt;\n        &lt;p&gt;\n          He said, that he never was, nor never intended to be a Robber or a Highway-man, and that he was never guilty of Theft, excepting the particular Fact for which he died; which (as he alledg'd) if he had not been advis'd, encourag'd, and very frequently press'd upon by another to commit, had never been done by him. The Person who advis'd him (as he said) was\n          &lt;persName id=&quot;OA17261103n14-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n14-1&quot;/&gt;\n            &lt;interp value=&quot;King&quot; type=&quot;surname&quot; inst=&quot;OA17261103n14-1&quot;/&gt;\n            &lt;interp value=&quot;Robert&quot; type=&quot;given&quot; inst=&quot;OA17261103n14-1&quot;/&gt;\n            Robert King\n          &lt;/persName&gt;\n          the\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-10&quot;&gt;Waggoner&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n14-1 OA17261103-occupation-10&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          , who was to have the one half of the Booty, whatever it happen'd to be; and who some Weeks before he rob'd the Waggon, at several times, and in different Places, most earnestly, and in an urgent Manner, Counsell'd him to Rob his Waggon, as it was going from\n          &lt;placeName id=&quot;OA17261103-geo-12&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-12&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 n14-1 OA17261103-geo-12&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Bistter\n          &lt;/placeName&gt;\n          to\n          &lt;placeName id=&quot;OA17261103-geo-13&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-13&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 n14-1 OA17261103-geo-13&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            London\n          &lt;/placeName&gt;\n          ; which he said, You may do it with the greatest Ease immaginable, for no manner of Opposition shall be made, yea, you\n        &lt;/p&gt;\n        &lt;xptr doc=&quot;OA172611030004&quot; type=&quot;pageFacsimile&quot;/&gt;\n        &lt;p&gt;\n          shall be rather encourag'd and forewarded in your Attempt. Otherways he said, excepting these importunate Solicitations of Mr. King, he had no Temptation to betake himself to the Highway, being capable to Live upon what he and his Wife had, and what he could make by his own Business like a Gentleman in the Country. A Gentlewoman who waited on Mr. Drury two or three Days, when he was first under Sentence, said, That as she was going out in a Chaise with Mr. Drury from\n          &lt;placeName id=&quot;OA17261103-geo-14&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-14&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-14&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            London\n          &lt;/placeName&gt;\n          to\n          &lt;placeName id=&quot;OA17261103-geo-15&quot;&gt;\n            &lt;join \n            targets=&quot;OA17261103n12-1 OA17261103-geo-15&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Wendover\n          &lt;/placeName&gt;\n          , the Waggoner met them, and desir'd Mr. Drury to come out for he wanted to speak with him; they going off from the Chaise at a good distance; the Gentlewoman could not hear what particulars they spoke upon; only she heard the Waggoner say, That he need not be afraid, and that he was sure to get what he wanted; or to that Purpose.\n        &lt;/p&gt;\n        &lt;p&gt;\n          But the Gentlewoman knowing nothing of their Communication at that Time could make no Judgment of the Words she heard pass between 'em. Strange it is indeed, that Mr. Drury should have rob'd a Waggon where so many People were concern'd, other Waggons also being in Company, and going the same way, without the least Opposition being offer'd him. The Day before his Death, he still reflected upon his Wife's Cruelty, and Brutishness, (as he call'd it) in not sending Money, or coming to him, being to leave the World so suddenly; who (added he) altho' he had been one of the most wicked Men ever was, yet she could not deny him to be her Husband, and as such, he conceiv'd that she was bound in Duty to wait upon and Assist him. I told him, however undutiful his Wife was, yet as a dying Man he should not entertain in his Mind, or show the least Resentment against her, especially in consideration of the heinous Crime he had committed, having thereby Disgrac'd not only himself, but also his Wife and Family: This he acknowledg'd, and appearing a little Easie, he declar'd that as a dying Man, and expected Mercy from God, he freely forgave all Injuries done him. The Evening before he Suffer'd, a Woman came to Mr. Drurey's Room-door in the Prison, and beg'd the favour to speak a word to him, he went to his Chamber-door; the Woman expressing her Sorrow to see him in that Condition; said, That she was desir'd by a certain Person to whom she had been Servant, to be informed by him, What he had to say about the Waggoner? Mr. Drurey reply'd, That the Thoughts of robbing Waggons or any Thing else, never enter'd into his Head, till the Waggoner advis'd, and frequently urg'd him to do it; and that his Blood, the loss of his Life, and all he had in this World lay upon him. I exhorted him to give over all Thoughts of Life, and to think seriously upon Death, for he still entertain'd thoughts of a Reprieve, by the Interest of a Man of Quality, till his Time drawing near; he said, that he submitted to the Will of God, who had justly chastis'd him for his Faults: I frequently advis'd him to try and search his Heart impartially, how it was dispos'd towards God, and Heavenly Things, to which he had been so much a Stranger; a manifest Instance of his Covetousness, appearing by his committing such a notorious Crime, as Robbing on the Highway. I desir'd him to Repent of all his Sins, particularly the notorious and scandalous Villainly for which he Died; not casting the blame upon any Person, but only his own wicked Heart and vicious Inclinations, not pretending Innocence in any respect. He own'd himself to've been a great Sinner, but not a Slave to any particular Vice; that he never was much guilty of Drinking to Excess; that he had been much addicted to Whoring; that he was truly Penitent for all his Offences, believing in Jesus Christ his only Saviour, thro' whose Merits he only expected his Sins to be Expiated, and his Soul to be Saved in the great Day of the Lord; declaring himself in Peace with all the World, and that he Died in Communion with this Church, of which he own'd himself an unworthy Member.\n        &lt;/p&gt;\n        &lt;p&gt;At the Place of Execution.&lt;/p&gt;\n        &lt;p&gt;\n          &lt;persName id=&quot;OA17261103n18-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n18-1&quot;/&gt;\n            &lt;interp value=&quot;DRUREY&quot; type=&quot;surname&quot; inst=&quot;OA17261103n18-1&quot;/&gt;\n            &lt;interp value=&quot;ANTHONY&quot; type=&quot;given&quot; inst=&quot;OA17261103n18-1&quot;/&gt;\n            ANTHONY DRUREY\n          &lt;/persName&gt;\n          , appear'd with abundance of Courage, as if he had not been much concern'd, and no ways afraid. Being ask'd if he had any thing to add to his former Confessions? He began and spoke a good while, the Substance of his Discourse was, That King the Waggoner was the only Person who put him upon and advis'd him to Rob the Waggon; and that he advis'd him also to Rob the Banbury Waggon, and his own Wife of 4 l. but that he got only 2 or 3 s. from her; he call'd King a very wicked Man, and pray'd God to forgive him, and bring him to a Sense of his Sin. He complain'd of his Wife's Unkindness, whom he also forgave, praying to God for her. At Newgate Prison before he went to Execution, a Man said, that he had married one Mr. Nichols's Daughter in the City of\n          &lt;placeName id=&quot;OA17261103-geo-16&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-16&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n18-1 OA17261103-geo-16&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Norwich\n          &lt;/placeName&gt;\n          , who is Sister to the said Man's Wife, and whom he left 7 Years ago, having married another Wife since. Being at the Place of Execution, I ask'd him about his multiplicity of Wives? he wav'd a positive Answer, saying, That he was loaded with many Reproaches by numbers of People, whom he heartily forgave. And calling to a Gentleman who was at the Place of Execution, he gave some private Directions relating to the Settlement of his Estate which he had before made. He gave several Advices to the Spectators to live Virtuous and godly Lives; and he hop'd to be Sav'd thro' the merits of Jesus Christ, and died apparently Penitent.\n        &lt;/p&gt;\n        &lt;p&gt;This is all the Account given by me,&lt;/p&gt;\n        &lt;p&gt;\n          &lt;persName id=&quot;OA17261103n20-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n20-1&quot;/&gt;\n            &lt;interp value=&quot;GUTHRIE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n20-1&quot;/&gt;\n            &lt;interp value=&quot;JAMES&quot; type=&quot;given&quot; inst=&quot;OA17261103n20-1&quot;/&gt;\n            JAMES GUTHRIE\n          &lt;/persName&gt;\n          ,\n          &lt;rs type=&quot;occupation&quot; id=&quot;OA17261103-occupation-11&quot;&gt;Minister&lt;/rs&gt;\n          &lt;join \n          targets=&quot;OA17261103n20-1 OA17261103-occupation-11&quot; targOrder=&quot;Y&quot; result=&quot;persNameOccupation&quot;&gt;\n&lt;/join&gt;\n          at\n          &lt;placeName id=&quot;OA17261103-geo-17&quot;&gt;\n            &lt;interp value=&quot;site&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-17&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n20-1 OA17261103-geo-17&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            Newgate\n          &lt;/placeName&gt;\n          .\n        &lt;/p&gt;\n        &lt;p&gt;\n          &lt;placeName id=&quot;OA17261103-geo-18&quot;&gt;\n            &lt;interp value=&quot;urban_centre&quot; type=&quot;type&quot; inst=&quot;OA17261103-geo-18&quot;/&gt;\n            &lt;join \n            targets=&quot;OA17261103n21-1 OA17261103-geo-18&quot; targOrder=&quot;Y&quot; result=&quot;persNamePlace&quot;&gt;\n&lt;/join&gt;\n            London\n          &lt;/placeName&gt;\n          ; Printed by\n          &lt;persName id=&quot;OA17261103n21-1&quot;&gt;\n            &lt;interp value=&quot;male&quot; type=&quot;gender&quot; inst=&quot;OA17261103n21-1&quot;/&gt;\n            &lt;interp value=&quot;APPLEBEE&quot; type=&quot;surname&quot; inst=&quot;OA17261103n21-1&quot;/&gt;\n            &lt;interp value=&quot;JOHN&quot; type=&quot;given&quot; inst=&quot;OA17261103n21-1&quot;/&gt;\n            JOHN APPLEBEE\n          &lt;/persName&gt;\n          in\n          &lt;placeName id=&quot;OA17261103-geo-19&quo
